import React from 'react';
import "./styles/HeaderBar.css"

const HeaderBar = () => {

    return (
        <nav>
            <div>
                <p><a href='/'>Characters</a></p>
                <p><a href='/'>Classes</a></p>
                
            </div>
            {/* <p className='middle'><a href='/'>Calculator</a></p> */}
            
        </nav>
    )
}

export default HeaderBar;
